<script lang="ts" setup>
useHead({ title: 'FAQ' })

definePageMeta({
  alias: '/basis_pengetahuan', // sesuai dari api/role-menu
})

const { $mitt, $api, $toast } = useNuxtApp()
const lang = ref({
  lang: ''
})
const loading = ref(false)
const options = ref(Array())
const selectAll = ref(false)
const faqList = ref()
const params = ref({
  q: '',
  sort: ''
})
const paramCategories = ref(Object())
const categories = ref()
const showFilter = ref(false)

$mitt.on('lang', (val: any) => {
  if (val.alias === '/basis_pengetahuan') {
    lang.value.lang = val.value
    localStorage.setItem('lang', val.value)
    getData()
    getDataCategory()
  }
})

const getData = async () => {
  loading.value = true
  const {
    data,
    error,
    pending
  } = await $api.faq.getFaq({ ...params.value, ...paramCategories.value, ...lang.value })
  if (data.value) faqList.value = data.value.data
  if (error.value) $toast.error(error.value.data.message)
  if (pending.value) loading.value = pending.value
  loading.value = false
}
getData()
const getDataCategory = async () => {
  loading.value = true
  const {
    data,
    error,
    pending
  } = await $api.faq.getFaqCategory(lang.value)
  if (data.value) {
    data.value.data.forEach((el: { name: String, id: String }) => {
      options.value.push({
        label: el.name,
        value: el.id
      })
    })
  }
  if (error.value) $toast.error(error.value.data.message)
  if (pending.value) loading.value = pending.value
  loading.value = false
}
getDataCategory()

watch(() => categories.value, (val) => {
  if (val.length) {
    selectAll.value = false
    paramCategories.value = {}
    val.forEach((el: String, i: Number) => {
      paramCategories.value[`service_category_id[${i}]`] = el
    })
  } else {
    paramCategories.value = {}
  }
  getData()
})
watch(() => params.value, (val) => {
  getData()
}, {
  deep: true
})
watch(() => selectAll.value, (val) => {
  if (val) {
    categories.value = []
    paramCategories.value = []
  }
  getData()
})
</script>
<template>
  <div>
    <LandingpageLayoutHeader name="FAQ" />
    <div class="p-8 lg:p-20 space-y-16 text-neutral-600">
      <div class="flex flex-col sm:flex-row gap-4 sm:gap-16">
        <CButton
          class="sm:hidden"
          :type="showFilter ? 'outlined' : 'filled'"
          :text="`${showFilter ? 'Sembunyikan' : 'Tampilkan'} Filter`"
          @click="showFilter = !showFilter"
        />
        <div class="flex flex-col p-8 gap-8 shadow-lg rounded-xl w-max">
          <ReInputText
            v-model="params.q"
            class="w-max"
            type="text"
            placeholder="Cari FAQ"
            icon="left"
            :require="false"
          >
            <template #icon>
              <Icon name="circum:search" color="black" size="22" />
            </template>
          </ReInputText>
          <div class="space-y-4" :class="showFilter ? 'block' : 'hidden lg:block'">
            <h1 class="font-bold">
              Kategori FAQ
            </h1>
            <div class="ml-6 space-y-4">
              <CheckBox v-model="selectAll" :checked="selectAll" id="all" label="Semua Kategori"  />
              <CheckBoxMulti v-model="categories" :options="options" />
            </div>
          </div>
          <div class="space-y-4" :class="showFilter ? 'block' : 'hidden lg:block'">
            <h1 class="font-bold">
              Urutkan
            </h1>
            <div class="ml-6 space-y-4">
              <RadioBox id="1" v-model="params.sort" value="desc">Terbaru</RadioBox>
              <RadioBox id="2" v-model="params.sort" value="asc">Terlama</RadioBox>
            </div>
          </div>
        </div>
        <div class="block lg:hidden flex flex-col justify-between">
          <CButton
            :type="showFilter ? 'outlined' : 'filled'"
            :text="`${showFilter ? 'Sembunyikan' : 'Tampilkan'} Filter`"
            @click="showFilter = !showFilter"
          />
          <CButton
            class="hidden sm:block"
            :type="showFilter ? 'outlined' : 'filled'"
            :text="`${showFilter ? 'Sembunyikan' : 'Tampilkan'} Filter`"
            @click="showFilter = !showFilter"
          />
        </div>
        <div class="flex flex-col gap-16 w-full">
          <template v-if="loading">
            <div class="w-full space-y-4">
              <SKeleton v-for="i in 3" :key="i" class="h-24 rounded-b-xl" />
            </div>
          </template>
          <template v-else>
            <LandingpageFaqList :data="faqList" />
          </template>
        </div>
      </div>
